import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './pages/Home';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Dashboard from './pages/Dashboard';
import TravellerListening from './pages/TravellerListening';
import Hire from './pages/Hire';
import Booking from './pages/Booking';
import AboutPage from './pages/AboutPage';
import LandingPage  from './pages/LandingPage';
import TravelerSignup from './pages/TravelerSignup';
import DriverSignup from './pages/DriverSignup';

function App() {
  return (
    <div className="App">
      
      <Header />
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/home" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/traveller-listening" element={<TravellerListening />} />
        <Route path="/hire" element={<Hire />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/travelersignup" element={<TravelerSignup />} />
        <Route path="/driversignup" element={<DriverSignup />} />
      </Routes>
      <Footer />
    </div>


    
  );
}

export default App;
